const Order = () =>{
    return (
        <div className="order">
           <div className="order-location">
            <h5>Location</h5>
            <p>Blk 43 L7 Caloocan City</p>
           </div>
           <div className="order-summary">
            <h2>Order Summary</h2>
            <h5>Subtotal</h5>
            <h5>Shipping Fee</h5>
           </div>
           <div className="order-total">
            <h5>Total</h5>
           </div>
           <button>PROCEED TO CHECKOUT</button>
        </div>
    );
};

export default Order;
